import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Dashboard() {
  const [data, setData] = useState([]);

  useEffect(() => {
    // Fetch data from your Node.js server, which should retrieve data from MongoDB
    axios.get('/api/data')
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <div>
      <h1>MongoDB Dashboard</h1>
      <ul>
        {data.map((item) => (
          <li key={item._id}>{item.fieldName}: {item.value}</li>
        ))}
      </ul>
    </div>
  );
}

export default Dashboard;
